import Header from "./components/Header";
import Characters from "./components/Characters";
import React, { useEffect } from "react";

function App() {
  var dark = false;
  var isDME = (isEnabled) => {
    dark = isEnabled;
    console.log(dark);
  };
  return (
    <div className="darkMode">
      <h1>Hola mundo</h1>
      <Header isDarkModeEnabled={isDME} />
      <Characters />
    </div>
  );
}

export default App;
